script: |
  super -f text -I q9326.spq | sort > q9326.out

inputs:
  - name: q9326.spq
    data: |
      SELECT - 18 FROM tab2 (FORMAT parquet) WHERE NULL BETWEEN + col1 * + - CAST ( NULL AS INTEGER ) * col1 + - col1 / col0 AND - - col2 + + col2;
  - name: tab2

outputs:
  - name: q9326.out
    data: |
